import React from 'react';
import ReactDOM from 'react-dom/client';
import Mercedes from './Car.js';


const root = ReactDOM.createRoot(document.getElementById('root'));

function addChild()
{
  return (
    <h1>Another child</h1>
  )
}

const element = <button onClick={addChild()}>Click me!</button>;

root.render(element);
